import React, { Component, useState } from 'react';
import Nav from "./Nav";
import axios from 'axios';


// const Home = (props) => {

class Home extends Component {
  constructor() {
    super();

    this.state = {
      hosp: {},

    }
  }

  async componentDidMount() {

    const response = await axios.get('http://localhost:8080/hospitalApp/hospital') // GET meth
    console.log(response.data);
    this.setState({
      hosp: response.data
    })
    console.log(this.state.hosp)
  }

  render() {
    return (
      <div>
        <div>
          <Nav user1={this.props.user} />
        </div>

        <div className="card text-body mb-3 w-25 h-100     m-4  bg-white">
          <div className="card-header"><h3>{this.state.hosp.hospName}</h3></div>
          <div className="card-body">
            <h5 className="card-title">beds occupied :{this.state.hosp.availableBeds}</h5>
            <h5 className="card-title">total beds : {this.state.hosp.totalBeds}</h5>
            <p className="card-text">

            </p>
          </div>
        </div>


      </div >
    )

  }
}

export default Home;
